передвижные медицинские комплексы – мобильные клиники (кабинеты) на базе автомобильного транспорта, оснащенные необходимым медицинским оборудованием, которые используются для обеспечения доступности и расширения перечня оказываемых медицинских услуг населению сельской местности и отдаленных населенных пунктов либо в интересах обороны и национальной безопасности;
медицинская авиация – предоставление скорой медицинской помощи в экстренной форме населению с привлечением воздушного транспорта;
медицинские поезда – мобильные клиники на железнодорожном транспорте, оснащенные необходимым медицинским оборудованием, используемые для обеспечения доступности и расширения перечня оказываемых медицинских услуг населению, проживающему возле железнодорожных станций (путей) и на близрасположенных к ним территориях;
